export interface PrivacyLocalization {
    /**
     * Privacy page strings
     */
    privacy: {
        /**
         * Privacy and security page title
         */
        pageTitle: string;
        /**
         * Privacy page sub header for basic settings
         */
        basicSettings: string;
        /**
         * Row title for password settings
         */
        passwordTitle: string;
        /**
         * Row title for Multi factor authentication settings
         */
        mfaTitle: string;
        /**
         * Text to be displayed inside MFA row if it's forced by vendor
         */
        mfaRequired: string;
        /**
         * Text to be displayed as popup when hovering on Mfa required text
         */
        mfaHelpMessage: string;
        /**
         * Text to be displayed if MFA is enabled
         */
        mfaEnabled: string;
        /**
         * Text to be displayed if MFA is disabled
         */
        mfaDisabled: string;
    };
    /**
     * Privacy page change password dialogs strings
     */
    privacy_ChangePassword: {
        /**
         * Change password dialog title
         */
        title: string;
        /**
         * Current password input label
         */
        currentPasswordInputLabel: string;
        /**
         * Error to be displayed if current password is empty
         */
        currentPasswordIsRequired: string;
        /**
         * New password input label
         */
        newPasswordInputLabel: string;
        /**
         * Error to be displayed if new password is empty
         */
        newPasswordIsRequired: string;
        /**
         * Confirm password input label
         */
        confirmPasswordInputLabel: string;
        /**
         * String displayed as placeholder when confirm password field is empty
         */
        confirmPasswordIsRequired: string;
        /**
         * Error displayed when passwords does not match
         */
        confirmPasswordMustMatch: string;
        /**
         * Dialog change password submit button
         */
        changePassword: string;
        /**
         * Dialog cancel button
         */
        cancel: string;
    };
    /**
     * Privacy page disable MFA dialogs strings
     */
    privacy_DisableMfa: {
        /**
         * Disable mfa dialog title
         */
        title: string;
        /**
         * Disable mfa dialog description message
         */
        description: string;
        /**
         * Disable token input label
         */
        tokenInputLabel: string;
        /**
         * Error displayed if code input is empty
         */
        codeIsRequired: string;
        /**
         * Error displayed if code input length less than 6 characters
         */
        codeLengthAtLeast6: string;
        /**
         * Disable token input placeholder
         */
        tokenInputLabelPlaceholder: string;
        /**
         * Cancel button text
         */
        cancel: string;
        /**
         * Disable mfa Submit button text
         */
        disable: string;
    };
    /**
     * Privacy page enable MFA dialogs strings
     */
    privacy_EnableMfa: {
        /**
         * Enable Mfa dialog title
         */
        title: string;
        /**
         * Enable Mfa dialog subtitle text
         */
        subtitle: string;
        /**
         * Enable MFA dialog Description "before" authenticator link
         */
        scanDescription1: string;
        /**
         * Enable MFA dialog Description "after" authenticator link
         */
        scanDescription2: string;
        /**
         * Enable MFA dialog code input label
         */
        codeInputLabel: string;
        /**
         * Enable MFA dialog code input placeholder
         */
        codeInputPlaceholder: string;
        /**
         * Error displayed if code input is empty
         */
        codeIsRequired: string;
        /**
         * Error displayed if code input length less than 6 characters
         */
        codeLengthAtLeast6: string;
        /**
         * Recovery code title after successfully enable mfa
         */
        recoveryCodeTitle: string;
        /**
         * Recovery code input label after successfully enable mfa
         */
        recoveryCodeLabel: string;
        /**
         * Recovery code instructions after successfully enable mfa
         */
        recoveryCodeInstructions: string;
        /**
         * Enable Mfa cancel button text
         */
        cancel: string;
        /**
         * Enable Mfa verify mfa code button text to enable mfa
         */
        verify: string;
        /**
         * Enable Mfa close button text after successfully enable mfa
         */
        close: string;
    };
    privacy_UserSessions: {
        /**
         * Login sessions table header text
         */
        loginSessionsTitle: string;
        /**
         * Table column text to be display as 'Device' header
         */
        deviceHeader: string;
        /**
         * Table column text to be display as 'Location' header
         */
        locationHeader: string;
        /**
         * Table column text to be display as 'IP Address' header
         */
        ipAddressHeader: string;
        /**
         * Table column text to be display as 'Time' header
         */
        timeHeader: string;
        /**
         * Table current session chip
         */
        currentSessionChip: string;
        /**
         * Table logout column action text
         */
        logout: string;
        /**
         * Table logout all button text
         */
        logoutAllButtonText: string;
        /**
         * Logout all dialog title
         */
        logoutAllDialogTitle: string;
        /**
         * Logout all dialog text
         */
        logoutAllDialogText: string;
        /**
         * Logout all accept button text
         */
        logoutAllDialogAcceptButton: string;
    };
}
